import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {Provider} from "react-redux";
import {store} from "./store/store";
import './index.css'

ReactDOM.render(
    <Provider store={store}>
        <div className='s'>
            <App/>
        </div>
    </Provider>,
    document.getElementById('root')
);
